const INITIAL_STATE = {
  data:[]
}

export default function AssetDevicesReducer(state = INITIAL_STATE, action) {
    switch (action.type) {
      case "FETCH_ASSET_DEVICES":
        const toos = action.payload.length
        console.log(toos);
        return {
          data: [...state.data, action.payload.length]
        };
      default:
        return state;
    }
  }
